import "./App.css";
import Layout from "./Layout/Layout";
import Grocery from "./components/Grocery";
import { MovieProvider, MovieContext } from "./components/Grocery";

function App() {
  const value = useContext(MovieContext);
  return (
    <div className="App">
      <Layout>
        <MovieContext.Provider value="wtf">
          <h1>wtf</h1>
        </MovieContext.Provider>
        <Grocery />
      </Layout>
    </div>
  );
}

export default App;
